public class Base64Test1 {
    @Test
    public void testDecodeBase64WithTrailingCharacters() {
        // Test case 1: Decode 'Zm9vYmF'
        byte[] decodedBytes1 = Base64.decodeBase64("Zm9vYmF");
        Assertions.assertArrayEquals(new byte[]{102, 111, 111, 98, 97}, decodedBytes1);

        // Test case 2: Decode 'Zm9vYmF~' (tilde character)
        byte[] decodedBytes2 = Base64.decodeBase64("Zm9vYmF~");
        Assertions.assertArrayEquals(new byte[]{102, 111, 111, 98, 97}, decodedBytes2);

        // Test case 3: Decode 'Zm9vYmF-' (hyphen character)
        byte[] decodedBytes3 = Base64.decodeBase64("Zm9vYmF-");
        Assertions.assertArrayEquals(new byte[]{102, 111, 111, 98, 97, 126}, decodedBytes3);

        // Test case 4: Decode 'Zm9vYmF~' (tilde character) again
        byte[] decodedBytes4 = Base64.decodeBase64("Zm9vYmF~");
        Assertions.assertArrayEquals(new byte[]{102, 111, 111, 98, 97}, decodedBytes4);
    }
}

