public class Base64EncodingTest {

    @Test
    public void testBase64DecodingWithSpecialCharacters() throws DecoderException {
        // Step 0: Prepare four distinct encoded text representations
        String encoded_rep_1 = Base64.encodeBase64String("fooba".getBytes()); // Base64 for "fooba"
        String encoded_rep_2 = Base64.encodeBase64String("fooba~".getBytes()); // Base64 for "fooba~"
        String encoded_rep_3 = Base64.encodeBase64String("fooba-".getBytes()); // Base64 for "fooba-"
        String encoded_rep_4 = Base64.encodeBase64String("fooba".getBytes()); // Base64 for "fooba" with tilde in a different position

        // Step 1: Define expected binary sequences
        byte[] expected_binary_1 = "fooba".getBytes();
        byte[] expected_binary_2 = "fooba~".getBytes();
        byte[] expected_binary_3 = "fooba-".getBytes();
        byte[] expected_binary_4 = "fooba".getBytes();

        // Step 3: Submit the first encoded representation to the decoding system
        byte[] decoded_output_1 = Base64.decodeBase64(encoded_rep_1);

        // Step 4: Verify the decoded output matches the expected binary sequence for 'fooba'
        assertArrayEquals(expected_binary_1, decoded_output_1, "Decoded output should match 'fooba'");

        // Step 6: Submit the second encoded representation to the decoding system
        byte[] decoded_output_2 = Base64.decodeBase64(encoded_rep_2);

        // Step 7: Verify the decoded output matches the expected binary sequence for 'fooba~'
        assertArrayEquals(expected_binary_2, decoded_output_2, "Decoded output should match 'fooba~'");

        // Step 9: Submit the third encoded representation to the decoding system
        byte[] decoded_output_3 = Base64.decodeBase64(encoded_rep_3);

        // Step 10: Verify the decoded output matches the expected binary sequence for 'fooba-'
        assertArrayEquals(expected_binary_3, decoded_output_3, "Decoded output should match 'fooba-'");

        // Step 12: Submit the fourth encoded representation to the decoding system
        byte[] decoded_output_4 = Base64.decodeBase64(encoded_rep_4);

        // Step 13: Verify the decoded output matches the expected binary sequence for 'fooba'
        assertArrayEquals(expected_binary_1, decoded_output_4, "Decoded output should match 'fooba'");
    }
