public class Base64DecoderTest {

    @Test
    public void testDecodeBase64WithTrailingCharacters() {
        // Step 0: Prepare four distinct Base64 encoded strings with varying trailing characters
        String partialEncodedString = "SGVsbG8=";
        String tildeEncodedString = "SGVsbG8=~";
        String hyphenEncodedString = "SGVsbG8=-";
        String variantEncodedString = "SGVsbG8=!";

        // Step 1: Prepare expected decoded byte arrays for each encoded string
        byte[] expectedBytesPartial = {0x48, 0x65, 0x6c, 0x6c, 0x6f};

        // Step 3: Invoke the static decodeBase64 method with the partial encoded string
        byte[] decodedBytesPartial = Base64.getDecoder().decode(partialEncodedString);

        // Step 4: Assert the returned byte array matches the expected five-byte sequence
        Assertions.assertArrayEquals(expectedBytesPartial, decodedBytesPartial);

        // Step 6: Invoke the static decodeBase64 method with the tilde-encoded string
        Assertions.assertThrows(IllegalArgumentException.class, () -> {
            Base64.getDecoder().decode(tildeEncodedString);
        });

        // Step 9: Invoke the static decodeBase64 method with the hyphen-encoded string
        Assertions.assertThrows(IllegalArgumentException.class, () -> {
            Base64.getDecoder().decode(hyphenEncodedString);
        });

        // Step 12: Invoke the static decodeBase64 method with the variant-encoded string
        Assertions.assertThrows(IllegalArgumentException.class, () -> {
            Base64.getDecoder().decode(variantEncodedString);
        });
    }
