public class Crc16Test1 {

    @ParameterizedTest
    @MethodSource("provideChecksumTestCases")
    public void testCrc16ChecksumAndReset(String sourceString, long expectedChecksum) {
        validateChecksumAndReset(sourceString, expectedChecksum);
    }

    private void validateChecksumAndReset(String sourceString, long expectedChecksum) {
        // Step 1: Instantiate CRC16 checksum with ARC variant
        Crc16 checksumInstance = Crc16.arc();

        // Step 2: Convert source string to US-ASCII byte array
        byte[] byteArray = StringUtils.getBytesUsAscii(sourceString);

        // Step 3: Update checksum instance with the entire byte array
        checksumInstance.update(byteArray, 0, byteArray.length);

        // Step 4: Retrieve computed checksum value
        long computedChecksum = checksumInstance.getValue();

        // Step 5: Assert computed checksum matches expected value
        assertEquals(expectedChecksum, computedChecksum, "Checksum does not match expected value.");

        // Step 6: Reset checksum state
        checksumInstance.reset();

        // Step 7: Update reset checksum with the same byte array
        checksumInstance.update(byteArray, 0, byteArray.length);

        // Step 8: Retrieve new checksum value
        long newChecksum = checksumInstance.getValue();

        // Step 9: Assert new checksum matches expected value to confirm reset restored initial state
        assertEquals(expectedChecksum, newChecksum, "Checksum after reset does not match expected value.");
    }

    private static Stream<Arguments> provideChecksumTestCases() {
        return Stream.of(
            Arguments.arguments("test", 63534L),
            Arguments.arguments("hello", 13522L)
        );
