        try (OutputStream fos = Files.newOutputStream(testRandomAccessFile)) {
            fos.write(testData);
        }
        testRandomAccessFileWrapper = new RandomAccessFile(testRandomAccessFile.toFile(), "rw");
    }

    private String cleanInput(String input) {
        return StringUtils.replaceChars(input, " ", "").toLowerCase(Locale.ROOT);
    }

    private boolean isJavaVersionCompatible() {
        return SystemUtils.isJavaVersionAtLeast(JavaVersion.JAVA_25);
    }

    private byte[] binaryStringToByteArray(String binaryString) {
        if (binaryString.length() % Byte.SIZE != 0) {
            throw new IllegalArgumentException(String.format("Binary string length must be a multiple of %,d.", Byte.SIZE));
        }
        byte[] byteArray = new byte[binaryString.length() / Byte.SIZE];
        for (int i = 0, j = 0; i < byteArray.length; i++, j += Byte.SIZE) {
            byteArray[i] = (byte) Integer.parseInt(binaryString.substring(j, j + Byte.SIZE), 2);
        }
        return byteArray;
    }

    @ParameterizedTest
    @MethodSource("provideBinaryInputData")
    public void testShake256_512(String binaryInputText, int inputBitSize, String hexOutputText) {
        String cleanBinary = cleanInput(binaryInputText);
        String cleanBinaryInput = StringUtils.reverse(cleanBinary);
        byte[] bytesInput = binaryStringToByteArray(cleanBinaryInput);
        String resultString = cleanInput(hexOutputText).substring(0, SHAKE128_512_BYTE_LEN * 2);
        byte[] resultBytes = Arrays.copyOf(Hex.decodeHex(resultString), SHAKE128_512_BYTE_LEN);
        boolean javaVersionCheck = isJavaVersionCompatible();

        if (javaVersionCheck) {
            Assertions.assertArrayEquals(resultBytes, DigestUtils.shake256_512(bytesInput));
            Assertions.assertEquals(resultString, DigestUtils.shake256_512Hex(bytesInput));
        } else {
            Assertions.assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512(bytesInput));
            Assertions.assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512(new ByteArrayInputStream(bytesInput)));
            Assertions.assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512Hex(bytesInput));
            Assertions.assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512Hex(new ByteArrayInputStream(bytesInput)));
        }
    }

    @AfterEach
    public void teardown() throws IOException {
        if (testRandomAccessFileWrapper != null) {
            testRandomAccessFileWrapper.close();
        }
        Files.deleteIfExists(testFile);
        Files.deleteIfExists(testRandomAccessFile);
    }

