import org.junit.jupiter.api.Assertions;
import java.io.ByteArrayInputStream;
import java.io.InputStream;
import java.util.stream.Stream;

public class HmacUtilsTest1 {

    private static final byte[] STANDARD_KEY_BYTES = "secret".getBytes();
    private static final byte[] STANDARD_PHRASE_BYTES = "The quick brown fox jumps over the lazy dog".getBytes();

    private static Stream<Arguments> hmacAlgorithms() {
        return Stream.of(
            Arguments.of("HmacMD5", "92345678"),
            Arguments.of("HmacSHA1", "12345678"),
            Arguments.of("HmacSHA224", "12345678"),
            Arguments.of("HmacSHA256", "12345678"),
            Arguments.of("HmacSHA384", "12345678"),
            Arguments.of("HmacSHA512", "12345678")
        );
    }

    @ParameterizedTest
    @MethodSource("hmacAlgorithms")
    public void testHmacHexWithInputStream(String algorithmName, String expectedString) {
        // Step 5: Verify the algorithm's availability
        Assertions.assertTrue(HmacUtils.isAvailable(algorithmName), 
            "Algorithm " + algorithmName + " is not available");

        // Step 6: Construct a new HmacUtils instance
        HmacUtils hmacUtils = new HmacUtils(algorithmName, STANDARD_KEY_BYTES);

        // Step 7: Wrap the standard phrase byte array within a ByteArrayInputStream
        InputStream inputStream = new ByteArrayInputStream(STANDARD_PHRASE_BYTES);

        // Step 8: Invoke the hmacHex method on the HmacUtils instance
        String computedDigest = hmacUtils.hmacHex(inputStream);

        // Step 9: Assert that the computed hexadecimal digest matches the expected result string
        Assertions.assertEquals(expectedString, computedDigest);
    }
}

