    public void testParsePhonemeExpr() {
        // Test case 1: invoke Rule.parsePhonemeExpr with string containing empty parentheses
        Rule.PhonemeExpr expr1 = Rule.parsePhonemeExpr("()");
        assertEquals(1, expr1.size());

        // Test case 2: invoke Rule.parsePhonemeExpr with string containing nested empty parentheses
        Rule.PhonemeExpr expr2 = Rule.parsePhonemeExpr("(())");
        assertEquals(1, expr2.size());

        // Test case 3: invoke Rule.parsePhonemeExpr with string containing empty group followed by pipe separator within parentheses
        Rule.PhonemeExpr expr3 = Rule.parsePhonemeExpr("(|)");
        assertEquals(2, expr3.size());

